import React from "react";

export default function CreateButton(props) {
    const button = {
        width: "100px",
        cursor: "pointer",
        background: "green",
        color: "white",
        "text-align": "center"
    };
    console.log("Createbutton props ->", props);
    return (
        <div style={button} onClick={props.showCreate}>
            Create
        </div>
    );
}
